import React from 'react';
import {
  Switch,
  Route,
} from "react-router-dom";
import Header from './components/layouts/header';
import ListAccounts from './components/accounts';
import TimeSheets from './components/timesheets'
import Profile from '../staff/components/profile'
import DayOff from './components/selection/dayOff/dayOff';
import OverTime from './components/selection/overTime/overTime';

function Main(props) {
  return (
    <div>
      <Header />
      <Switch>
        <Route exact path="/">
          <ListAccounts />
        </Route>
        <Route exact path="/timesheets">
          <TimeSheets />
        </Route>
        <Route exact path="/profile">
          <Profile />
        </Route>
        <Route exact path="/dayoff">
          <DayOff />
        </Route>
        <Route exact path="/overtime">
          <OverTime />
        </Route>
      </Switch>
    </div>
  )
}

export default Main;
